XML-Class.MessageCode:
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using PrimeWebControl.BaseElement.Variable;
using PrimeWebControl.BaseElement.Localization;
using PrimeWebControl.BaseElement.Device_Template;

namespace PrimeWebControl.BaseElement.Message
{
	public partial class TMessageScript
	{

		
		public void ExecuteMessage(TTemplateVariable Message)
		{
			if (Message.Get() == "0")
			{
				if (GetVarBool(Message.Device,"$Read124"))
				{
					Message.Set("1");
				}
				
			}
			else
			{
				if (!GetVarBool(Message.Device,"$Read124"))
				{
					Message.Set("0");
				}
			}
		}
	}
}

